script: |
  super -f text -I q9205.spq | sort > q9205.out

inputs:
  - name: q9205.spq
    data: |
      SELECT DISTINCT - col0 FROM tab1 (FORMAT parquet) WHERE NOT col0 * - col1 + col1 + - col2 IN ( + col2 + col2 );
  - name: tab1

outputs:
  - name: q9205.out
    data: |
      -3
      -64
      -80
